/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `first_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `last_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `gender` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `address` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `city` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `phone` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `notes` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `permissions` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `last_login` timestamp NULL DEFAULT NULL,
  `lat` double DEFAULT 0,
  `lng` double DEFAULT 0,
  `country_id` int(1) DEFAULT NULL,
  `user_name` varbinary(255) DEFAULT NULL,
  `otp_code` varbinary(10) DEFAULT NULL,
  `otp_status` int(1) DEFAULT NULL,
  `active_status` int(1) DEFAULT NULL,
  `otp_created` text COLLATE utf8_unicode_ci DEFAULT NULL,
  `business_id` int(1) DEFAULT 0,
  `plan_id` int(1) DEFAULT NULL,
  `plan_status` int(1) DEFAULT NULL,
  `plan_active_date` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `plan_expired_date` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `operation_type` int(1) DEFAULT NULL,
  `start_time` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `end_time` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL,
  `collector_role` text COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `users_email_unique` (`email`)
